import React from 'react';

const Login = (props) => {
	return <div>
		<h1>Login</h1>
		<form>
			<div>
				<input type="text" placeholder={'Login'}/>
			</div>
			<div>
				<input type="pass" placeholder={'Password'}/>
			</div>
			<div>
				<input type="checkbox" id={'remember-me'}/>
			</div>

		</form>
	</div>;
};

export default Login;
